def generate_password(length=12, include_numbers=True, include_capital_letters=True, include_special_characters=True):

     # Define a pool of characters to choose from based on user options
    characters = string.ascii_lowercase

    if include_numbers:
        characters += string.digits
    if include_capital_letters:
        characters += string.ascii_uppercase
    if include_special_characters:
        characters += string.punctuation

    # Generate the password randomly
    password = ''.join(random.choice(characters) for _ in range(length))

    return password




